export default () => {
    const [state, setState] = useState({
        [IDS.NAME]: "",
        [IDS.SURNAME]: "",
      });
  return (
    <>
      <Navbar />
      <Container>
        <form>
          <input placeholder="Title..." />
          <input placeholder="Post..." />
          <button type="submit">Submit</button>
        </form>
      </Container>
    </>
  );
};

const Container = styled.div``;
